import axios from "axios";
//import { GET_ALL_DOGS_BACK } from "../../../vite.config";
import { GET_ALL_DOGS } from "../actionstypes/actionsType";

const getAllDogs = () => {
  return async (dispatch) => {
    const response = await axios.get(
      "https://pindividualback-production.up.railway.app/dogs"
    );
    dispatch({ type: GET_ALL_DOGS, payload: response.data });
  };
};

export default getAllDogs;
